import { GlobalProvider } from "./context/GlobalContext";

function App() {
  return (
    <div>
      <div className="container">
        <Header />
        <Balance />
        <IncomeExpenses />
        <TransactionList />
        <AddTransaction />
      </div>
    </div>
  );
}

export default App;
